import React from 'react'
import { Header, Icon, Image, Menu, Segment, Sidebar, Button, Grid } from 'semantic-ui-react'



class SidebarExampleSidebar extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      visible: false
    }
  }

  setVisible() {
    const { visible } = this.state;
    const change = !visible
    this.setState({ visible: change })
  }

  render() {
    return (
      <React.Fragment>
      <Sidebar.Pushable as={Segment}>
      <Sidebar
        as={Menu}
        animation='overlay'
        icon='labeled'
        inverted
        onHide={() => this.setVisible(false)}
        vertical
        visible={this.visible}
        width='thin'
      >
        <Menu.Item as='a'>
          <Icon name='home' />
          Home
        </Menu.Item>
        <Menu.Item as='a'>
          <Icon name='gamepad' />
          Games
        </Menu.Item>
        <Menu.Item as='a'>
          <Icon name='camera' />
          Channels
        </Menu.Item>
      </Sidebar>

      <Sidebar.Pusher>
        <Segment basic>
          <Header as='h3'>Application Content</Header>
          <Grid>
            <Grid.Column width={6}></Grid.Column>
            <Grid.Column width={6}>
              <Button onClick={this.setVisible}>Click Me</Button>
            </Grid.Column>
          </Grid>u
        </Segment>
      </Sidebar.Pusher>
    </Sidebar.Pushable>
    </React.Fragment>
    );
  }
}

export default SidebarExampleSidebar
